import React from 'react'
import styled from 'styled-components'
import {Link} from "react-router-dom";
import PaginationItem from '@material-ui/lab/PaginationItem';
import {Pagination as MaterialPagination} from '@material-ui/lab';

const Pagination = styled(({countPages, handlePageChange, currentPage, ...props}) => (
    <MaterialPagination
        count={countPages} onChange={handlePageChange}
        page={currentPage}/>
        ))
    .attrs({
        renderItem: (item) => (
            <PaginationItem
                component={Link}
                to={`/compositions${item.page === 1 ? '' : `?page=${item.page}`}`}
                {...item}
            />)
    })``

export default Pagination
